import React from "react";
import "../styles/banner.css"

function Banner(){
    return (
        <div className="Banner">
            <h1>MyTinerary</h1>
            <h2>Find your perfect trip, designed by insiders who know and love their cities!</h2>
        </div>
    )
}
export default Banner
